import React from 'react';

function About(props) {
	return (
		<div className='about-site'>
			<h1 className='about-txt'>About</h1>
			<p className='about-txt'>

				BMI strongly correlate with BF % estimated by bioelectrical impedance,
				in this sub population of South Asian adults. This relationship was
				curvilinear in nature and was significantly influenced by age and
				gender. Science findings support the importance of taking age and gender
				in to consideration when using BMI to predict body fat
				percentage/obesity, in a population.
			</p>
		</div>
	);
}

export default About;
